    assert!(-s[3] * 1 + s[2] <= RealNumRep::new(0, 1));
    assert!(-s[4] * 1 + s[3] <= RealNumRep::new(0, 1));
    assert!(l[1] + -a[1] * 1 + s[1] <= RealNumRep::new(0, 1));
    assert!(s[2] + l[2] + -a[2] * 1 <= RealNumRep::new(0, 1));
